#[cfg(test)]
mod tests {
    use utile::resource::{RawResource, RawResourceExt};

    use crate::resource::Genomes1000Resource;

    use super::*;

    #[test]
    #[ignore]
    fn test_grch38_reference_genome() {
        env_logger::Builder::new()
            .filter_level(log::LevelFilter::Debug)
            .filter_module("reqwest", log::LevelFilter::Info)
            .filter_module("hyper_util", log::LevelFilter::Info)
            .init();

        let resource = Genomes1000Resource::grch38_reference_genome()
            .log_progress()
            .with_global_fs_cache()
            .ensure_cached()
            .unwrap()
            .decompressed()
            .buffered();

        let mut reader = noodles::fasta::io::Reader::new(resource.read().unwrap());

        for (ord, record) in reader.records().enumerate() {
            let (name, meta) = meta(ord, &record.unwrap());

            println!("{name:?} => {meta:?},");
        }
    }

    #[test]
    #[ignore]
    fn test_grch38_contig_meta() {
        env_logger::Builder::new()
            .filter_level(log::LevelFilter::Debug)
            .filter_module("reqwest", log::LevelFilter::Info)
            .filter_module("hyper_util", log::LevelFilter::Info)
            .init();

        let resource = Genomes1000Resource::grch38_reference_genome()
            .log_progress()
            .with_global_fs_cache()
            .ensure_cached()
            .unwrap()
            .decompressed()
            .buffered();
        let mut reader = noodles::fasta::io::Reader::new(resource.read().unwrap());

        for (ord, record) in reader.records().enumerate() {
            let record = record.unwrap();

            let (name, meta) = meta(ord, &record);

            assert_eq!(super::META[&name], meta);
        }
    }

    fn meta(ord: usize, record: &noodles::fasta::Record) -> (String, ContigMeta) {
        let definition = record.definition().to_string();
        let definition = definition.strip_prefix('>').unwrap();

        let (name, description) = definition.split_once(' ').unwrap();

        let meta = match &*description.split_whitespace().collect::<Vec<_>>() {
            [id, len, "bp"] => {
                let len = len.parse::<u64>().unwrap();
                ContigMeta {
                    ord,
                    len,

                    accession: None,
                    geninfo_id: None,
                    imgt_hla_id: Some(id.to_string().leak()),
                    role: None,
                    m5: None,
                    assembly: None,
                    hm: None,
                    tp: None,
                    ref_group: None,
                    sp: None,
                }
            }
            values => {
                let mut ac: Option<&'static str> = None;
                let mut gi: Option<&'static str> = None;
                let mut ln: Option<&'static str> = None;
                let mut rl: Option<&'static str> = None;
                let mut m5: Option<&'static str> = None;
                let mut as_: Option<&'static str> = None;
                let mut hm: Option<&'static str> = None;
                let mut tp: Option<&'static str> = None;
                let mut ref_group: Option<&'static str> = None;
                let mut sp: Option<&'static str> = None;
                for value in values {
                    match value.split_once(':').unwrap() {
                        ("AC", v) => ac = Some(v.to_string().leak()),
                        ("gi", v) => gi = Some(v.to_string().leak()),
                        ("LN", v) => ln = Some(v.to_string().leak()),
                        ("rl", v) => rl = Some(v.to_string().leak()),
                        ("M5", v) => m5 = Some(v.to_string().leak()),
                        ("AS", v) => as_ = Some(v.to_string().leak()),
                        ("hm", v) => hm = Some(v.to_string().leak()),
                        ("tp", v) => tp = Some(v.to_string().leak()),
                        ("rg", v) => ref_group = Some(v.to_string().leak()),
                        ("SP", v) => sp = Some(v.to_string().leak()),
                        (p, _) => panic!("Invalid description: {description} (key: {p})"),
                    }
                }
                ContigMeta {
                    ord,
                    len: ln.unwrap().parse::<u64>().unwrap(),

                    accession: ac,
                    geninfo_id: gi,
                    imgt_hla_id: None,
                    role: rl,
                    m5,
                    assembly: as_,
                    hm,
                    tp,
                    ref_group,
                    sp,
                }
            }
        };

        (name.to_owned(), meta)
    }
}
